/* Line.js */
import React from 'react';

const LineWithDots = () => {
  return(
    <div className="LineWithDots">
      <span className="Dot"></span>
      <span className="Line"></span>
      <span className="Dot"></span>
    </div>
  )
}

export default LineWithDots;
